	(1338,'http://www.villagevoice.com/events/larry-david-2661555/','Larry David','larry-david','If you thought this city didnt have room for another cynical yet funny-as-hell bald old man who complains about, well, everything, think again, because the king of all whiners, Larry David, is coming home. Last season on Curb Your Enthusiasm, we saw the multimillionaire go to desperate measures to get his wife back, even reuniting the cast of Seinfeld in order to write her into the episode. Tonight, cast members David, Susie Essman, and Jeff Garlin discuss the new season and the shows big move from L.A. to New York, Davids hometown. Andwho knows?maybe coming home will finally make David content with his life. But probably not.',4,'2011-07-05 19:00:44','2011-07-19 17:09:36','http://www.villagevoice.com/events/larry-david-2661555/','','',34,'',1,0,'a3dd5d9496'),
