	(218,'http://www.villagevoice.com/events/material-lab-2388433/','Material Lab','material-lab','There have been countless times that weve strolled through MOMA, come upon an arousing piece, and dug in our bag looking for a pen to make a note for later inspiration. But what if you could create your own artwork inspired by the eclectic ambience of the museum right there and then? The new  Material Lab  allows you to do that, and, even better, you dont have to bring your entire collection of scraps, paints, pencils, Crayons, glue sticks, or anythingthey provide all the supplies! The interactive space also includes a digital painting program, so you can take your art on-the-go, leave it to inspire others, or start your own gallery in your living room. The possibilities are endless.',4,'2011-06-14 15:51:45','2011-07-19 17:09:36','http://www.villagevoice.com/events/material-lab-2388433/','http://vvoice.vo.llnwd.net/e14//5968238.47.jpg','',127,'event_images/43dc54fb03b18d335ba564925ace149c9983c083_2.jpg',1,193,'fc477602ff'),
