	(916,'http://www.villagevoice.com/events/side-effects-2588120/','Side Effects','side-effects','Theater so rarely provides the sequel-satisfaction that the movies do. In 2008, Michael Weller\'s explosive domestic quarrel of a play,  Fifty Words , left a few loose ends untied. One of those was a phone call Jan made to the home of her philandering husband Adam\'s mistressâa call cut short by even more screaming and tears. Now, Joely Richardson and Cotter Smith star as Lindy and Hugh, the couple on the other end of that line, in Weller\'s follow-up,  Side Effects . As their relationship crumbles, MCC Theater adds another example of the devastating destruction of a marriage to its repertoire.',4,'2011-06-14 15:53:16','2011-07-19 17:09:40','http://www.villagevoice.com/events/side-effects-2588120/','http://vvoice.vo.llnwd.net/e14//6413009.47.jpg','',125,'event_images/f3a12c8e3db1a3cd9dcebb66f3bc6c62ec25d899_1.jpg',1,0,'1661b11a40'),
