	(980,'http://www.villagevoice.com/events/high-and-low-2621343/','High and Low','high-and-low','Dir. Akira Kurosawa (1963) Kurosawa creates his own double-bill in this engrossing policier set against Japans economic miracle. The first half is a morally complex kidnapping drama in which the wrong kid is nabbed; the second is the Dostoyevskian search for the perp. HOBERMAN.',4,'2011-06-14 15:53:25','2011-07-19 17:09:41','http://www.villagevoice.com/events/high-and-low-2621343/','','',173,'',1,18,'ea29c0b201'),
