	(1027,'http://www.villagevoice.com/events/john-zorn-and-tyshawn-sorey-2621143/','John Zorn & Tyshawn Sorey','john-zorn-tyshawn-sorey','Drummer Sorey is one of the most engaging wild cards on the local improv scene--a master of quiet chemistry at one gig and pummeling percussion at the next. Bet his pow-wow with experimental maestro Zorn yields the kind of acute dynamics that generate an edge-of-your-seat vibe. If there is one thing that they both agree upon, it\'s dramatic impact. Tim Berne\'s Los Totopos shares the bill.',4,'2011-06-14 15:53:31','2011-07-19 17:09:41','http://www.villagevoice.com/events/john-zorn-and-tyshawn-sorey-2621143/','http://vvoice.vo.llnwd.net/e14//6533324.47.jpg','',137,'event_images/8954619a3f8d2b635d251bea3e1d162dda6a0c22_1.jpg',1,2,'18ef39943b'),
