	(1029,'http://www.villagevoice.com/events/nancy-grossman-2588041/','Nancy Grossman','nancy-grossman','You don\'t need to have an s/m fetish to like the work of veteran artist Nancy Grossmanbut it doesn\'t hurt if you do. Her latest solo exhibition,  Heads , features 14 sculpturesferocious leather-hooded heads carved from blocks of found woodthat she made from the \'60s through the \'80s. Though Grossman is accomplished in many areas of art, it was her heads that made her a star of the art world in the 1960s, with five solo shows by the time she turned 30. Both Robert Mapplethorpe and Richard Avedon memorably photographed her masks of zippers, spikes, straps, and recycled leather (including material from boxing gloves!). Though Grossman has called these lifesize heads \"self-portraits,\" they are not actual depictions of her face. Instead, her deaf and mute sculptures, influenced by the liberation movements of the \'60s and the Vietnam War, continue to bear silent witness to the world\'s violence.',4,'2011-06-14 15:53:31','2011-07-19 17:09:41','http://www.villagevoice.com/events/nancy-grossman-2588041/','http://vvoice.vo.llnwd.net/e14//6364684.47.jpg','',127,'event_images/68c79eacfc88c6dd0388a5bbfbfbe7de6cd2d35b_2.jpg',1,0,'159a8f48c1'),
