	(1060,'http://www.villagevoice.com/events/craig-taborn-2623935/','Craig Taborn','craig-taborn','There\'s a consensus in Jazzville: pianist Taborn\'s new  Avenging Angel  is one of the most enthralling solo discs to come along this year. Eschewing trad melodies, his recital teems with the kind of poised abstraction that finds utility in curiosity. There are moments when it feels like he\'s playing a particular phrase just to see how the instrument will react. How such passages wind up carrying so much gravitas, I\'ll never know, but this I\'m sure of: the Rubin is the perfect room for this show.',4,'2011-06-14 15:53:36','2011-07-19 17:09:41','http://www.villagevoice.com/events/craig-taborn-2623935/','http://vvoice.vo.llnwd.net/e14//6541428.47.jpg','',137,'event_images/8fe9c2b6f7bdbee47dbbc69fe571e2ac23a80b50.jpg',1,4,'62b1a8b92e'),
