	(1112,'http://www.villagevoice.com/events/katy-perry-robyn-2623955/','Katy Perry+Robyn','katy-perryrobyn','Pint-sized Swedish singer Robyn has had a remarkable career revival after a short-lived run as a late-\'90s teen pop vixen, and it is built equally of oddball quirk and genuinely brilliant hooks. Regardless of what ridiculous things she may shoot out from her breasts (frosting, fireworks, teenage dreams), Katy Perry certainly can\'t operate without hooks, as well--let\'s hope there\'s some generational cross-pollination backstage during this tour that encourages Robyn to take the Linda Perry route with her late career renaissance.',4,'2011-06-14 15:53:43','2011-07-19 17:09:42','http://www.villagevoice.com/events/katy-perry-robyn-2623955/','http://vvoice.vo.llnwd.net/e14//6541462.47.jpg','',137,'event_images/a54c325f639d2ef5ba672624a69eedf8354df1a9.jpg',1,0,'6cd77e8966'),
