	(1123,'http://www.villagevoice.com/events/perspectives-forming-the-figure-1924337/','Perspectives: Forming the Figure','perspectives-forming-the-figure','\"The idea of character is thematically relevant to a deeper exploration of traditional folk art and the work of contemporary self-taught artists, a far-reaching field that pervades a broad spectrum of American culture and reflects many different communities. This exhibition, the second installment of the Perspectives series organized by the museums education department, examines some of the many facets of figure in works from the permanent collection.\"',4,'2011-06-14 15:53:44','2011-07-19 17:09:42','http://www.villagevoice.com/events/perspectives-forming-the-figure-1924337/','','',121,'',1,3,'7348380de4'),
	(1124,'http://www.villagevoice.com/events/aaron-lazar-2621210/','Aaron Lazar','aaron-lazar','Since there are so many to-plotz-for leading men festooning Broadway musicals nowadays, it\'s not wise to point to a first among warbling equals. The unwise reporter, however, might point to this fellow, whose voice could melt the hardest heart. He\'s done just that in  Light in the Piazza  and even in the  Little Night Music  revival while playing a cad. What he croons as himself will be something to see and especially to hear. Just hope he includes Adam Guettel and Stephen Sondheim if he decides to serenade Broadway-style.',4,'2011-06-14 15:53:44','2011-07-19 17:09:42','http://www.villagevoice.com/events/aaron-lazar-2621210/','http://vvoice.vo.llnwd.net/e14//6541478.47.jpg','',137,'event_images/a0f15cfedf2928ac92a6526928659601f97f2889.jpg',1,6,'33e3a0e77f'),
	(1125,'http://www.villagevoice.com/events/lysistrata-jones-2559076/','Lysistrata Jones','lysistrata-jones','Recently Douglas Carter Beane was hired to doctor the script of  Sister Act  and now he has teamed with Lewis Flinn to update Aristophanes play about a sex strike. Does the man have a thing for celibacy? Minimizing the political content, Flinn and Beane reset the action amid a womens college basketball team.',4,'2011-06-14 15:53:44','2011-07-19 17:09:42','http://www.villagevoice.com/events/lysistrata-jones-2559076/','http://vvoice.vo.llnwd.net/e14//6349307.47.jpg','',125,'event_images/8b58133715db00e126a099d60a9e881bdc3cd86d.jpg',1,0,'f176ca5ccc'),
