	(1146,'http://www.villagevoice.com/events/west-side-story-891841/','West Side Story','west-side-story','I like it here in America, sings a character in this Arthur Laurents/ Leonard Bernstein/Stephen Sondheim musical. And America likes you, toothats the hope of 91-year-old Laurents who directs this Broadway revival. This version emphasizes the shows multiculturalism, with many of the Sharkss songs translated into Spanish.',4,'2011-06-14 15:53:47','2011-07-19 17:09:42','http://www.villagevoice.com/events/west-side-story-891841/','http://vvoice.vo.llnwd.net/e14//3044504.47.jpg','',124,'event_images/2f124e1329c49d1eda20d64e23e9a5efea7b1ba8_1.jpg',1,0,'a3c1fd899c'),
