	(1150,'http://www.villagevoice.com/events/the-men-2621191/','The Men','the-men','Now ensconced in the Sacred Bones fold with the just-released  Leave Home , Brooklyn cranks the Men have their six feet firmly planted at the junction of hype and awesome. Advance track \"Bataille\" really did splinter wood and singe eyebrows, and the trio\'s checkered past of tapes and 7\" releases regularly aligned caterwaul with brain glue hooks. So who\'s to say they can\'t take the trite universe by swarm? With Milk Music, Nude Beach, and the Marsh Hens.',4,'2011-06-14 15:53:48','2011-07-19 17:09:42','http://www.villagevoice.com/events/the-men-2621191/','http://vvoice.vo.llnwd.net/e14//6533321.47.jpg','',137,'event_images/09a06c593f9a464e69a66932bd399a5f63c47a16.jpg',1,0,'aaf566cef9'),
