	(1166,'http://www.villagevoice.com/events/elastic-city-walking-tour-1823707/','Elastic City Walking Tour','elastic-city-walking-tour','Artist Todd Shalom founded Elastic City to carry out a specific mission: To push on the walking tour tradition and reveal new ways of experiencing New York. The various walks explore urban design, typography, architecture, poetry, ritualistic performance, sound art and psychotherapy. Among the inaugural season offerings are a walk with theater director Niegel Smith, in which participants will brave local security in downtown Manhattan and trail the routines of our elected officials in public spaces; a walk to the World Trade Center site by psychotherapist Robert Mauksch that will incorporate landscape embodiment\" techniques; and a soundwalk around DUMBO by Daniel Neumann.',4,'2011-06-14 15:53:50','2011-07-19 17:09:42','http://www.villagevoice.com/events/elastic-city-walking-tour-1823707/','','',171,'',1,0,'8a5171c865'),
	(1167,'http://www.villagevoice.com/events/abracadabra-presents-the-crystal-ark-2624002/','Abracadabra Presents the Crystal Ark','abracadabra-presents-the-crystal-ark','Gavin Russom is a fixture on DFA\'s noble roster, thanks to his soaring work with Delia Gonzalez and as Black Meteoric Star. His Crystal Ark work comes out of an attempt to unite European electronic music with comparable South American party music. The 9-piece live incarnation of the Crystal Ark features fellow DFA folks Tyler Pope and Matt Thornley as well as multimedia artist Viva Ruiz. With DJ sets from Saheer Umar (of NYC\'s superb and aptly named House of House) and Venus and $hayne, plus visuals by Bec Stupac (Deitch Projects) and Johnny Woods (Honeygun Labs).',4,'2011-06-14 15:53:50','2011-07-19 17:09:42','http://www.villagevoice.com/events/abracadabra-presents-the-crystal-ark-2624002/','http://vvoice.vo.llnwd.net/e14//6541628.47.jpg','',137,'event_images/7c31e7bcd394f496da9044b30c28c63c203e327d.jpg',1,0,'197d281d78'),
