	(1209,'http://www.villagevoice.com/events/hbo-bryant-park-summer-film-festival-2622533/','HBO Bryant Park Summer Film Festival','hbo-bryant-park-summer-film-festival','Looking for a fun (and free) way to spend your Monday nights? The annual tradition of packing a picnic basket and blanket and heading to the  HBO Bryant Park Summer Film Festival  returns with more classic movies on the lawn through August. It kicks off with Milos Forman\'s  One Flew Over the Cuckoo\'s Nest , based on the book by Ken Kesey. The 1975 drama, which won the top five awards at the Oscars, stars Jack Nicholson as a mental-hospital patient who leads a revolt against the hardened Nurse Ratched. Come back next Monday for Alfred Hitchcock\'s The 39 Steps. No time to pack a dinner? Place your order in advance with \'wichcraft (212-780-0577,  wichcraftnyc.com ) and pick it up at their kiosk.',4,'2011-06-14 15:53:56','2011-07-19 17:09:42','http://www.villagevoice.com/events/hbo-bryant-park-summer-film-festival-2622533/','http://vvoice.vo.llnwd.net/e14//6533729.47.jpg','',29,'event_images/daaf4d912653716304133cd9814f4d7008c3c0a2.jpg',1,34,'8132fdb6f1'),
