	(2570,'http://www.villagevoice.com/events/b-is-for-beautiful-2692374/','B is for Beautiful','b-is-for-beautiful','B is for Beautiful  was originally planned as a fundraiser to help with hospital bills for Cheryl B., the Downtown poet, writer, and performer who was diagnosed with Stage 2B Hodgkin\'s lymphoma last November. But early in the morning on June 18, the beloved, bitingly sarcastic wordsmith died from complications related to chemotherapy, at the age of 38. Cheryl was a fixture at readings around the city, hosting Sideshow: the Queer Literary Carnival and appearing frequently at lit-romps at KGB bar, among others. After her diagnosis, she continued to write and perform, appearing bald at readings and, when she was too sick to go out, blogging about her experience at wtfcancerdiaries.com. So with a show-must-go-on determination that would have suited her, Cheryl\'s partner, comic Kelli Dunham, and friends, have turned the event into a memorial, where colleagues and loved ones can pay tribute to this sorely missed artist.',4,'2011-07-22 14:50:21','2011-07-22 15:43:02','http://www.villagevoice.com/events/b-is-for-beautiful-2692374/','','',28,'',1,0,'664b050a27'),
