	(2582,'http://www.villagevoice.com/events/disappears-2686543/','Disappears','disappears','Disappears have wrought something revelatory from same-old scorched earth distortion. On  Lux  and  Guider , both for the Chicago imprint Kranky, songs foment from chants, thumps, and clanging echoes; it is the sound of wizards conjuring rock music from a hailstorm. It\'s that chipping away and reformation that they do so well. Have we heard it before? Maybe. Or is it just the reverberation of hive mind memory? With Psychic Paramount.',4,'2011-07-22 14:50:24','2011-07-22 15:43:02','http://www.villagevoice.com/events/disappears-2686543/','','',137,'',1,0,'fa3e95e1f1'),
	(2583,'http://www.villagevoice.com/events/talk-to-me-2692402/','Talk to Me','talk-to-me','We communicate with machines all day, whether we\'re using our computers, smartphones, buying a MetroCard, or taking out cash from the ATM. But what if these machines communicated back? The new exhibit  Talk to Me  allows them to do just that. It features about 200 objects ranging from iconic products of the late \'60s to new ones currently in development, including check-in kiosks, apps, websites, video games, even furniturebasically any technologically advanced invention that we use in our daily lives that can translate and deliver information. The only difference in this show is that we can form a dialogue with them. We already know our iPhone would say, \"Give me a break already!\"',4,'2011-07-22 14:50:24','2011-07-22 15:43:02','http://www.villagevoice.com/events/talk-to-me-2692402/','','',127,'',1,0,'60ebe25263'),
