	(2646,'http://www.villagevoice.com/events/black-francis-reid-paley-2680628/','Black Francis+Reid Paley','black-francisreid-paley','The first half of 2011 was unusually quiet for the prolific Pixies frontman Black Francis. He toured very little and only released a few recordings in dribs and drabs: a soundtrack to the \'20s silent flick  The Golem  and a duet with Ray Davies. All will be right in the State of Francis, though, beginning with this tour. His performance tonight features his recent collaborator, singer-songwriter Reid Paley, with whom he\'s releasing an album in September. Beyond that, he\'s releasing a box set of his Frank Black and the Catholics recordings and possibly a new album with his wife in their band Grand Duchy. Enjoy this before he moves onto something new.',4,'2011-07-22 14:50:43','2011-07-22 15:43:02','http://www.villagevoice.com/events/black-francis-reid-paley-2680628/','','',137,'',1,0,'ac1e12ab64'),
