	(2652,'http://www.villagevoice.com/events/wet-hot-american-summer-2692687/','Wet Hot American Summer','wet-hot-american-summer','Remember all the good times you had at Camp Firewood when Janeane Garofalo was your unstable camp director, Paul Rudd was the hot counselor, and David Hyde Pierce kept warning everyone that a piece of NASAs Skylab was going to destroy the whole camp? Tonight, reunite with all your old buddies at the 10th anniversary celebration of the cult classic  Wet Hot American Summer . Directed by David Wain and co-written by Wain and Michael Showalter, the offbeat film features a hilarious cast including Michael Ian Black, Molly Shannon, Amy Poehler, and Bradley Cooper. Rumor has it that Wain is mulling over a sequel (or maybe a prequel). Till then, enjoy this screening hosted by the comedy trio STELLA, featuring Black, Showalter, and Wain.',4,'2011-07-22 14:50:46','2011-07-22 15:43:02','http://www.villagevoice.com/events/wet-hot-american-summer-2692687/','','',29,'',1,0,'4d54557b42'),
