	(2656,'http://www.villagevoice.com/events/four-adventures-of-reinette-and-mirabelle-2692409/','Four Adventures of Reinette and Mirabelle','four-adventures-of-reinette-and-mirabelle','Last month, BAMcinématek celebrated the 25th anniversary of French New Wave director Eric Rohmers 1986 masterpiece  Le Rayon vert (Summer) . Now, in part two of this series, theyve resurrected Rohmers lesser-known companion piece to that film,  Four Adventures of Reinette and Mirabelle . Shown in a fresh 35mm print, the 1987 film concerns two young womenthe naïve country lass Reinette (Joëlle Miquel) and the pretty city sophisticate Mirabelle (Jessica Forde)who quickly become friends when Mirabelle pops her bike tire near Reinettes home. Reinette convinces Mirabelle to stay over and wait for the silent blue hour before dawn. Then Mirabelle talks Reinette into being her roommate in Paris. As they face a comic cast of Parisian characters in sections titled The Waiter and The Beggar, the Kleptomaniac, and the Hustler, Rohmer explores what happens to sweet innocence in the big city. Bring your BFF.',4,'2011-07-22 14:50:46','2011-07-22 15:43:02','http://www.villagevoice.com/events/four-adventures-of-reinette-and-mirabelle-2692409/','','',29,'',1,0,'420c5dbbea'),
