	(2727,'http://www.villagevoice.com/events/punderdome-3000-2692716/','Punderdome 3000','punderdome-3000','Shakespeare was a master of puns. Take, for instance, the dying Mercutio in  Romeo and Juliet , who says, \"Ask for me tomorrow, and you shall find me a grave man.\" Whether you can be as eloquent as the Bard or just plain punny, the  Punderdome 3000  wants you to put your wit to the test in a fast-faced challenge where only the bravest wordsmith will survive. Participants are given a theme and 90 seconds to write a pun on it with winners chosen by a \"clap-o-meter.\" And the stakes are high! In May, the grand prize was a toaster. Who wouldn\'t want that?',4,'2011-07-22 14:51:11','2011-07-22 15:43:03','http://www.villagevoice.com/events/punderdome-3000-2692716/','','',33,'',1,0,'7c200003bd'),
