	(2737,'http://www.villagevoice.com/events/the-fine-art-of-comics-with-gary-panter-art-spiegelman-and-chris-ware-2678153/','The Fine Art of Comics With Gary Panter, Art Spiegelman, and Chris Ware','the-fine-art-of-comics-with-gary-panter-art-spiege','New Yorkborn artist Lyonel Feininger may have made a name for himself overseas as a German expressionist and leading figure of the Bauhaus, but its his two cartoon strips that ran in The Chicago Tribune from 1906 to 1907 (The Kin-der-Kids and Wee Willie Winkies World) that our best cartoonists today still drool over. As Art Spiegelman (Maus) has said, His handful of Sunday pagestesting the uncharted waters between the high and low arts, between European and American graphic traditionsremains his greatest aesthetic triumph. Tonight, at  The Fine Art of Comics With Gary Panter, Art Spiegelman, and Chris Ware , the cartoonists discuss how Feininger elevated the lowly comic strip to greatly influence graphic novelists for the past several decades. John Carlin moderates the discussion, which is part of the new retrospective Lyonel Feininger: At the Edge of the World.',4,'2011-07-22 14:51:15','2011-07-22 15:43:03','http://www.villagevoice.com/events/the-fine-art-of-comics-with-gary-panter-art-spiegelman-and-chris-ware-2678153/','','',34,'',1,0,'59f6e5bda7'),
