	(2762,'http://www.villagevoice.com/events/death-from-above-1979-2692368/','Death From Above 1979','death-from-above-1979','Toronto dance-punks  Death From Above 1979  have been in a finicky way lately. They quarreled often and broke up in 2006, following the release of their only album,  You\'re a Woman, I\'m a Machine , which asserted them on dance floors like few other acts (the Rapture, Justice, the occasional Black Rebel Motorcycle Club blip). Singer Sebastien Grainger went on to release softer electro solo work, bass/synthist Jesse F. Keller devoted himself fully to MSTRKRFT. Then this year, they returned for a triumphant spray of festival shows: SXSW, Coachella, Sasquatch, the upcoming Lollapalooza, Summer Sonic (in Tokyo and Osaka, Japan), and Reading (in England). Catch them in a one-off riverside set and hope they play nicethen again, their visceral dance fare is worth a little friendly fire.',4,'2011-07-22 14:51:22','2011-07-22 15:43:03','http://www.villagevoice.com/events/death-from-above-1979-2692368/','','',137,'',1,0,'49220f37ab'),
