	(2769,'http://www.villagevoice.com/events/joel-grey-a-new-york-life-2669604/','Joel Grey/A New York Life','joel-greya-new-york-life','Joel Grey/A New York Life examines the enduring impact that performer and photographer Joel Grey and his adopted city have made on each other. Through rare artifacts from his stage and screen career, objects from his personal collection, and his own photography, the exhibition offers a unique look at New York through Greys eyes. Joel Grey/A New York Life will include posters, playbills, and costume pieces from Greys iconic productions, combined with a selection of his New York City photographs. Together, they dramatize how the breadth of his artistic work has been nurtured and inspired by his life in New York City.',4,'2011-07-22 14:51:25','2011-07-22 15:43:03','http://www.villagevoice.com/events/joel-grey-a-new-york-life-2669604/','','',127,'',1,0,'42753c2c12'),
