	(2795,'http://www.villagevoice.com/events/amp-it-up-imaginative-ways-to-keep-sparks-flying-in-your-sex-play-2671248/','Amp It Up: Imaginative Ways to Keep Sparks Flying in Your Sex Play','amp-it-up-imaginative-ways-to-keep-sparks-flying-i','Sometimes we like sex the way we like our favorite frozen pizza: cooked fast, tasting pretty good, and made to satisfy our hunger. Because who wants to go that extra mile for pizza? Amp It Up: Imaginative Ways to Keep Sparks Flying in Your Sex Play teaches you how to make that extra mile fun and interesting. Ducky Doolittle will help you get out of your generic sex routine by showing you new ways to give and receive pleasure, as well as incorporate flirting, sex toys, and new techniques using your tongue, fingers, and toes. So, basically, its a win-win situation.',4,'2011-07-22 14:51:33','2011-07-22 15:43:03','http://www.villagevoice.com/events/amp-it-up-imaginative-ways-to-keep-sparks-flying-in-your-sex-play-2671248/','','',142,'',1,0,'4148d21088'),
	(2796,'http://www.villagevoice.com/events/olive-and-the-bitter-herbs-2680580/','Olive and the Bitter Herbs','olive-and-the-bitter-herbs','At a Passover celebration, guests are made to ask, \"Why is this night different from all other nights?\" At a Charles Busch play, it isn\'t hard to find answers: There\'s the droll dialogue, the B-movie pastiche, the fevered pace, the camp sensibilities, the drag performances that aren\'t a drag in the least. In Busch\'s latest opus,  Olive and the Bitter Herbs , which plays out during a Passover meal, over-the-hill actress Olive (Marcia Jean Kurtz) has a lot on her seder plate. Having peaked in the \'80s with a sausage commercial, she must now contend not only with finding work, but also with a ghost lingering in her mirror and a bevy of neighbors interested in the phantom. Director Mark Brokaw is sure to leaven the action at the Primary Stages premiere, co-starring Julie Halston, Dan Butler, Richard Masur, and David Garrison.',4,'2011-07-22 14:51:34','2011-07-22 15:43:03','http://www.villagevoice.com/events/olive-and-the-bitter-herbs-2680580/','','',125,'',1,0,'4a88934cda'),
