	(2820,'http://www.villagevoice.com/events/cracker-2689513/','Cracker','cracker','Led by David Lowery--a complex irono-hippie who, at age 50, still sounds like a teenage SoCal stoner--Cracker specializes in crackling pop-punk. Guitarist Johnny Hickman and bassist Sal Maida are casually outstanding energizers who make tunes such as \"Get on This\" and \"Let\'s Go for a Ride\" sound better than they probably deserve to. \"Friends,\" the ragged-but-righteous drinking-buddies highlight of last year\'s  Sunrise in the Land of Milk and Honey , may also be the only tune to (quite justifiably) tout the late Captain Beefheart\'s music as hot make-out material. With Wormburner.',4,'2011-07-22 14:51:41','2011-07-22 15:43:03','http://www.villagevoice.com/events/cracker-2689513/','','',137,'',1,0,'94d75ba2a7'),
