	(2835,'http://www.villagevoice.com/events/clutch-corrosion-of-conformity-2691869/','Clutch+Corrosion of Conformity','clutchcorrosion-of-conformity','Clutch traveled back in time recently, reissuing their 2004 record  Blast Tyrant  and presenting a combo meal of live material and road movie called  Live at the 9:30 . The Maryland rockers are veterans by now, and enjoy the kind of core following that makes reissues and ambitious live packages warranted or even necessary. They\'re a loud engine constantly turning over and transforming into a throaty roar, and that\'s the way their people like it. Corrosion of Conformity, meanwhile, will appear as a trio, drawing heavily from their 1985 Metal Blade classic  Animosity . With Groundscore.',4,'2011-07-22 14:51:46','2011-07-22 15:43:03','http://www.villagevoice.com/events/clutch-corrosion-of-conformity-2691869/','','',137,'',1,0,'25bee68d50'),
	(2836,'http://www.villagevoice.com/events/eugene-mirman-and-pretty-good-friends-featuring-todd-barry-patton-oswalt-and-kristen-schaal-with-musical-guest-they-might-be-giants-2672472/','Eugene Mirman & Pretty Good Friends featuring Todd Barry, Patton Oswalt, and Kristen Schaal with musical guest They Might Be Giants','eugene-mirman-pretty-good-friends-featuring-todd-b','Eugene Mirman is a comedian and hero who lives in Brooklyn, NY. He is a regular on Flight of the Conchords, Adult Swims Delocated, had his own special on Comedy Central, and voices Gene in the new animated Fox series Bobs Burgers.',4,'2011-07-22 14:51:46','2011-07-22 15:43:03','http://www.villagevoice.com/events/eugene-mirman-and-pretty-good-friends-featuring-todd-barry-patton-oswalt-and-kristen-schaal-with-musical-guest-they-might-be-giants-2672472/','','',139,'',1,0,'c35c08f590'),
	(2837,'http://www.villagevoice.com/events/otherworldly-optical-delusions-and-small-realities-2672484/','Otherworldly: Optical Delusions and Small Realities','otherworldly-optical-delusions-and-small-realities','The hyper-realistic imagery of the 37 contemporary artists, who are reviving and expanding the diorama as a medium for contemporary art, draws viewers into fantastical lands, surreal spaces, and peculiar environments challenging their sense of what is real and what is fabricated.',4,'2011-07-22 14:51:47','2011-07-22 15:43:03','http://www.villagevoice.com/events/otherworldly-optical-delusions-and-small-realities-2672484/','','',121,'',1,0,'ec462a4635'),
