	(2842,'','\'Stars of Tomorrow\' Outdoor Concert','stars-tomorrow-outdoor-concert','The New School for Jazz & Contemporary Music continues their partnership with the Hudson River Park Trust for another season of wonderful free outdoor concerts on the River. Enjoy the summer sun, fresh breezes and great music by the \'Stars of Tomorrow\'. You can take advantage of the long days and the slower pace of summer in the city by joining us on the beautiful Pier 45 on alternate Tuesdays from 6:30 to 8:00 PM. Drummer Dorota Piotrowska leads her group next week on the evening of Tuesday, July 26th.\r\n',NULL,'2011-07-22 16:20:07','2011-07-22 16:22:08','http://www.newschool.edu/Mannes/events.aspx?id=68375','','',30,'event_images/dorotaPiotrowska2.jpg',1,0,'451c20350f'),
	(2843,'','India Day Parade & Festival','india-day-parade-festival','Join over 150,000 people in the streets of Midtown New York City for one of the world\'s largest celebrations of India\'s national independence. The parade begins at 12:00 noon at Madison Ave & 38th St, and should last for about 3 hours on its way down to 27th St. It will be led by Grand Marshall Rani Mukherjee, the beautiful and talented Bollywood actress. Also in attendance will be Bharrat Jagdeo, President of the Republic of Guyana, as well as the Indian classical vocalist Pandit Jasraj and Bollywood star Gulshan Grover. The parade will of course feature a wide array of marching bands, cultural groups, and themed floats.\r\n\r\nThere will also be a street fair with an exciting assortment of food and merchandise between 25th & 27th St that will run from 11:00 AM until 6:00 PM. Once you\'ve had your fill, head on down to the exhibition of dance and cultural performances at 23rd St & Madison (following the parade, until about 6:00 PM as well). This 31st annual event is sponsored by the Federation of Indian Associations.',NULL,'2011-08-19 17:43:12','2011-08-19 17:55:11','http://fianynjct.org/cms/Home.html','','',114,'event_images/imageFormatted.jpg',1,0,'47b5a9d7ef');

