	(5,'http://www.villagevoice.com/events/know-your-product-349818/','Know Your Product','know-your-product','Gerald from Other Music spins left-field hits and misses.',4,'2011-06-14 15:51:17','2011-07-19 17:09:35','http://www.villagevoice.com/events/know-your-product-349818/','','',138,'',1,0,'a11bcca8d5'),
	(6,'http://www.villagevoice.com/events/bitter-bingo-2561773/','Bitter Bingo','bitter-bingo','Bianca del Rio hosts Vlada\'s game night. Winners take home prizes like liquor, porn, and jocks.',4,'2011-06-14 15:51:17','2011-07-19 17:09:35','http://www.villagevoice.com/events/bitter-bingo-2561773/','','',169,'',1,1,'fe086ecdba'),
