	(9,'http://www.villagevoice.com/events/doomed-love-2613098/','Doomed Love','doomed-love','Dir. Andrew Horn (1983). Preceded by a film short.',4,'2011-06-14 15:51:17','2011-07-19 17:09:35','http://www.villagevoice.com/events/doomed-love-2613098/','','',173,'',1,0,'9aebd37e3d'),
	(10,'http://www.villagevoice.com/events/verboten-disasters-presents-matthew-dear-manik-2624014/','Verboten Disasters Presents Matthew Dear+MANIK','verboten-disasters-presents-matthew-dearmanik','An endless stream of solid releases under his various guises have made Texas-born Matthew Dear into Ghostly International/Spectral Sound\'s standout star. He\'s made poppy techno (and now retro noir) under his own name, serious club techno as Audion, and minimal as False--and, well, we\'ll just hope for all of it in his long set today. Queens-born young MANIK has already churned out records for Poker Flat and Hot Creations; this afternoon, he celebrates the release of his first LP, the housey, Warriors-sampling  Armies of the Night , on Josh Wink\'s Ovum Recordings. With Naudio, Shadi Megallaa, and Danielle Nicole.',4,'2011-06-14 15:51:17','2011-07-19 17:09:35','http://www.villagevoice.com/events/verboten-disasters-presents-matthew-dear-manik-2624014/','http://vvoice.vo.llnwd.net/e14//6541741.47.jpg','',137,'event_images/65b1e81e23990cfcbb81b4d449884599a9f37256_1.jpg',1,0,'99a29d6b46'),
	(11,'http://www.villagevoice.com/events/intro-to-swing-and-salsa-1953604/','Intro to Swing and Salsa','intro-to-swing-and-salsa','If your only move is the two-step, then you might be in need of some formal training. This class will run you through the basics of swing and salsa.',4,'2011-06-14 15:51:18','2011-07-19 17:09:35','http://www.villagevoice.com/events/intro-to-swing-and-salsa-1953604/','','',4,'',1,0,'b7f4172407'),
