	(142,'http://www.villagevoice.com/events/blissfully-yours-2621377/','Blissfully Yours','blissfully-yours','Dir. Apichatpong Weerasethakul (2002).\nTwo couples enter the state of nature in Thai director Weerasethakuls deadpan, self-consciously primitive gloss on Renoirs rueful  A Day in the Country . Bad filmmaking or an artfully artless breakthrough,  Blissfully Yours  is unconscionably happy.',4,'2011-06-14 15:51:35','2011-07-19 17:09:36','http://www.villagevoice.com/events/blissfully-yours-2621377/','http://vvoice.vo.llnwd.net/e14//6530105.47.jpg','',29,'event_images/db296320bbd47287450b3c6ce2b9672b4db3bf3b_1.jpg',1,0,'d6ddc0fd56'),
