	(156,'http://www.villagevoice.com/events/great-speeches-and-other-outbursts-2622531/','Great Speeches & Other Outbursts','great-speeches-other-outbursts','What makes a great speech? According to tips from Toastmasters, you should \"know the audience,\" \"realize that people want you to succeed,\" and \"practice, practice, practice.\" We\'re sure that the performers at tonight\'s  Great Speeches & Other Outbursts , a benefit for the writing program for children 826NYC, will employ all these tactics and more as they aim to re-create the magic of some very famous speakers.  This American Life \'s Ira Glass will have the arduous task of channeling both Abraham Lincoln and Buffy the Vampire Slayer; comedian John Hodgman will give a speech by Theodore Roosevelt;  Strangers With Candy \'s Amy Sedaris promises to give a dazzling Amway pep talk; and  The Motherf***er With the Hat \'s Bobby Cannavale will read the words of Mario Cuomo. Also on the program, hosted by the lovely Sarah Vowell, are Eric Bogosian, Wyatt Cenac, and John Oliver. Let\'s just hope they don\'t try that other great public-speaking tactic for nerves: imagining the audience nude.',4,'2011-06-14 15:51:37','2011-07-19 17:09:36','http://www.villagevoice.com/events/great-speeches-and-other-outbursts-2622531/','http://vvoice.vo.llnwd.net/e14//6533728.47.jpg','',34,'event_images/417be71c86928c7daa1b696d8f866c532d566d48_1.jpg',1,0,'0146f95afa'),
