	(671,'http://www.villagevoice.com/events/singular-visions-2406281/','Singular Visions','singular-visions','With our latest re-installation of the permanent collection galleries, the Whitney invites visitors to slow down and experience art in a dramatic new way. Twelve major postwar works, many of which have not been exhibited in years, are presented in their own rooms, creating spaces for intimate and powerful encounters with a single work of art. The variety of mediums and sizes from small to sprawling reveal how artists of the last five decades have stretched the boundaries of what an artwork can be.',4,'2011-06-14 15:52:44','2011-07-19 17:09:39','http://www.villagevoice.com/events/singular-visions-2406281/','','',121,'',1,13,'ab66cf994b'),
