	(690,'http://www.villagevoice.com/events/lorna-simpson-2447614/','Lorna Simpson','lorna-simpson','Artist  Lorna Simpson s signature photographs play with juxtaposition, placing images and text side-by-side to create a unique narrative. Although she had once said that she never appeared in her images, she does in her new show Gathered. Like Cindy Sherman, Simpson, a Brooklyn native, steals the spotlight in her own pieces that re-create or mimic black-and-white images of African Americans from the 50s, many of which she found on eBay and in flea markets. For instance, in one piece, we see a pinup girl from the postwar era alongside a photo of Simpson, posing precisely the same way to show a shared identity across history. Also on view will be her series of installations of black-and-white photo-booth images of African-Americans during the Jim Crow era.',4,'2011-06-14 15:52:46','2011-07-19 17:09:39','http://www.villagevoice.com/events/lorna-simpson-2447614/','http://vvoice.vo.llnwd.net/e14//6081834.47.jpg','',127,'event_images/cf61b79194c46fd14b2494bd3803be8aa678949a_3.jpg',1,14,'63e79b35ea'),
