	(1330,'http://www.villagevoice.com/events/the-low-anthem-2617558/','The Low Anthem','the-low-anthem','Performing more seance than concert, these latter-day troubadours conjure the ghosts of hitchhikers, vagabonds, and hapless dreamers, those lonely hearts who measure their lives by the exit signs on Guthrie\'s ribbon of highway and whose names only the wind remembers. On  Smart Flesh , they paint a sweeping tableau of pastoral Americana from the inside out that eschews the obvious totems--Leonard Cohen, Tom Waits, Townes Van Zandt--and finds their voice in lovelorn, dirge-like elegies that evoke rainy days and summer ennui. Get ready to step into an Andrew Wyeth watercolor that knows how to rock. With These United States and Daniel Lefkowitz.',4,'2011-06-14 15:54:13','2011-07-19 17:09:43','http://www.villagevoice.com/events/the-low-anthem-2617558/','http://vvoice.vo.llnwd.net/e14//6533299.47.jpg','',137,'event_images/42ed1946f25b149e1a77a5d7fec82c01184912bd.jpg',1,15,'3d613be6f0'),
