	(1426,'http://www.villagevoice.com/events/xavier-cha-body-drama-2654503/','Xavier Cha: Body Drama','xavier-cha-body-drama','Artist Xavier Cha, based in New York, has a funny way of twisting realities. Through video and performance art, she can make the most random day-to-day occurrences (like those annoying human-advertising costumes on street corners) seem pretty spectacular and the moments that should be awesome (like two people embraced in a passionate kiss on a busy New York City street) seem, actually, well . . . boring. Her aim is to explore the interaction between the action taking place and the viewer. In Chas new exhibit, Body Drama, an actor performs on a stage while wearing a body-mounted camera. Viewers get two different performances, the one by the dancer in front of them and the one projected on the wall, both of which center on disorienting psychological and physical space. Pretty trippy.',4,'2011-07-05 19:01:05','2011-07-19 17:09:44','http://www.villagevoice.com/events/xavier-cha-body-drama-2654503/','','',121,'',1,0,'7d6741abb4'),
