	(1508,'http://www.villagevoice.com/events/the-metropolitan-opera-summer-recital-series-2658694/','The Metropolitan Opera Summer Recital Series','the-metropolitan-opera-summer-recital-series','The Metropolitan Opera Summer Recital Series, first presented in 2009, returns this year with six performances all five boroughs.\r\n\r\nThis performance features favorite rising stars Angela Meade (soprano), Dimitri Pittas (tenor), Jennifer Johnson Cano (mezzo-soprano) accompanied by pianist Bradley Moore. For more information on the entire series, please visit: Metopera.org/parks.\r\n\r\nAngela Meade has appeared at the Met as Elvira in Ernani (debut, 2008) and the Countess in Le Nozze di Figaro, and returns next season as Elvira and in the title role of Anna Bolena. A 2007 winner of the Met’s National Council Auditions, she was featured in the documentary film, The Audition, about that competition.\r\n\r\nDimitri Pittas’ season highlights include Macduff in Macbeth at Covent Garden, Edgardo in Lucia di Lammermoor with Houston Grand Opera, and the title role of Faust with the Santa Fe Opera. His Met roles include Tamino in The Magic Flute and Nemorino in L’Elisir d’Amore. He returns to the Met next season as Rodolfo in La Bohème and Macduff.\r\n\r\nJennifer Johnson Cano made her Met debut in 2009 in Le Nozze di Figaro followed by the Sandman in Hansel and Gretel and this past season sang Wellgunde in Das Rheingold at the Met and Lyudmila in the Met/Juilliard School joint production of The Bartered Bride.\r\n\r\nBradley Moore is currently an assistant conductor at the Metropolitan Opera. He has performed with the world’s greatest artists and symphonies, and continues to work with notable conductors at leading opera houses.\r\ninfo@SummerStage.org',4,'2011-07-05 19:01:22','2011-07-19 17:09:44','http://www.villagevoice.com/events/the-metropolitan-opera-summer-recital-series-2658694/','','',30,'event_images/TheMetImage.png',1,0,'8272549696'),
