	(1518,'http://www.villagevoice.com/events/soundgarden-2659648/','Soundgarden','soundgarden','If AutoTuning your solo album with Timbaland doesn\'t work, it\'s time to return to your roots--or maybe Chris Cornell\'s triumphant reorganization of Seattle grunge-via-metal heavies Soundgarden last year was wholly organic. Either way, fans of the most ultramega riff rockers of the \'90s are winning one for once. Unlike the dodgy concert disc  Live on I-5  released this year, which captures lackluster performances (to put it politely) from 1996, the band has been sounding energized and usually on pitch at their recent reunion shows. Just don\'t stare too deeply into guitarist Kim Thayil\'s chin fleece. With prog rockers Coheed & Cambria.',4,'2011-07-05 19:01:24','2011-07-19 17:09:44','http://www.villagevoice.com/events/soundgarden-2659648/','','',137,'',1,0,'d012cf3744'),
