	(1529,'http://www.villagevoice.com/events/kid-rock-sheryl-crow-2654495/','Kid Rock+Sheryl Crow','kid-rocksheryl-crow','One in Nashville mainstream country, the other in rap metal pyromania, Kid Rock and Sheryl Crow first came together in the cheating heart confessional \"Picture\" in 2002. They\'ve since returned with another barstool duet, \"Collide,\" that makes the most of their odd-couple chemistry--Sheryl Crow humanizes the Kid, while he returns her to her low-down roots. Like chasing a shot of Jagermeister with glass of honeyed bourbon, watch beauty meet the mook tonight, including sets from both performer\'s exhaustive catalogues.',4,'2011-07-05 19:01:26','2011-07-19 17:09:44','http://www.villagevoice.com/events/kid-rock-sheryl-crow-2654495/','','',137,'',1,0,'1ca67b310c'),
