	(1533,'http://www.villagevoice.com/events/ladybug-transistor-james-ausfahrt-2647267/','Ladybug Transistor+James Ausfahrt','ladybug-transistorjames-ausfahrt','Brooklyn\'s the  Ladybug Transistor  enjoy a cushy spot in the Elephant Six Collective, indie pop\'s own Brat Pack (with more beards, less montages, and equal emoting), and are flying high on this month\'s release of seventh album  Clutching Stems  (on Merge). They love that nature imagery as much as they do amiably peppy hooks (next comes a dance craze called the Aphid, perhaps?). \"Awkward and edgy\" is a common consensus of  James Ausfahrt , singer of Sweden\'s Love Is All, and also of his name\'s uncomfortable proximity to the very edge of our maturity threshold. With the Beets.',4,'2011-07-05 19:01:27','2011-07-19 17:09:44','http://www.villagevoice.com/events/ladybug-transistor-james-ausfahrt-2647267/','','',137,'',1,0,'e943950def'),
