	(1541,'http://www.villagevoice.com/events/cold-cave-2658656/','Cold Cave','cold-cave','On their latest album,  Cherish the Light Years , dark synth-pop outfit Cold Cave have added members from Xiu Xiu, Prurient, and L.A. punk band Mika Miko to their impressive, assorted lineup. Since their first release, 2009\'s  Love Comes Close , Cold Cave\'s sound is now heavier and more confidently diverse--they go smoothly from ambient, industrial track \"Burning Sage\" to \"Catacombs,\" a poppy New Order-esque dance jam (we all love to dance to songs about haunted underground tombs!). The gothic theatrics can be a little over the top, but when your aesthetic is shamelessly based around a Robert Smith/ Peter Murphy/Edward Cullen trifecta, it\'d be disappointing if it weren\'t. With Cult of Youth and Zambri.',4,'2011-07-05 19:01:30','2011-07-19 17:09:44','http://www.villagevoice.com/events/cold-cave-2658656/','','',137,'',1,0,'488420e1b0'),
