	(1544,'http://www.villagevoice.com/events/latin-alternative-music-conference-2647270/','Latin Alternative Music Conference','latin-alternative-music-conference','While we always look forward to the new indie sounds that the  Latin Alternative Music Conference  brings forth every summer, we can\'t help but feel giddy about the resonating musicians from yesteryear that will be playing this year (and with new material!).This four-day music schmooze fest, which features panels with music insiders, will include performances by our favorite East Los rock quintet Los Lobos, the melodic Jarabe de Palo from Barcelona, and  rockera  goddess Ely Guerra. Of course we\'re also excited to check out what the kids are listening to these days--Diego Garcia, Hello Seahorse!, and local boys DJs Uproot Andy and Geko Jones (of Que Bajo?!) will no doubt have us dancing all night.',4,'2011-07-05 19:01:30','2011-07-19 17:09:44','http://www.villagevoice.com/events/latin-alternative-music-conference-2647270/','','',137,'',1,0,'1fb474a4fc'),
