	(1579,'http://www.villagevoice.com/events/grooms-2654665/','Grooms','grooms','Brooklyn three-piece Grooms trade the kind of achingly fuzzed-out \'90s indie rock that replaces the Pains Of Being Pure At Heart\'s scenester-spotting with sincerity. (One track titled \"Prom\" mostly repeats the phrase \"And I wanna be friends with you.\") Prone to playing loose and jammy love songs that unravel like a thrift shop sweater, they\'re sonically austere but emotional. Enjoy a perfect pairing at Williamsburg fly-by-night venue Death By Audio with local bands Pterodactyl and the Immaculates.',4,'2011-07-05 19:01:37','2011-07-19 17:09:44','http://www.villagevoice.com/events/grooms-2654665/','','',137,'',1,0,'ee2e74f1c0'),
