	(1612,'http://www.villagevoice.com/events/mazes-2644103/','Mazes','mazes','Even for music fans, it might be a little confusing to think that any band that comes out of Manchester doesn\'t resemble Joy Division, New Order, the Fall, or Happy Mondays. It is also a little confusing that there is another band from Chicago called  Mazes. But this particular U.K. combo is looking to make a name for themselves by moving from lo-fi experiments into indie-pop bliss on their debut album. They\'ve also shifted during their extensive storming of our shores from opening for White Denim to becoming the headliners. With Beige, Country Mice, and the Hairs.',4,'2011-07-05 19:01:44','2011-07-19 17:09:45','http://www.villagevoice.com/events/mazes-2644103/','','',137,'',1,0,'6f336efde5'),
	(1613,'http://www.villagevoice.com/events/afrolicious-pleasuremaker-senor-oz-2659799/','\'Afrolicious: Pleasuremaker+Senor Oz\'','afrolicious-pleasuremakersenor-oz','San Francisco\'s beloved Afrolicious party breaks out of its Elbo Room base for an East Coast mini-tour. Residents Pleasuremaker and Senor Oz have spent the last four years channeling tropicalia, Afrobeat, funk and disco classics, and live percussion into a mighty good time. They\'ve worked with Thievery Corporation and with artists from Burkina Faso, Trinidad and Tobago, and Honduras. It\'s all documented on their mixtape series, but this is one of the few nights that\'s (almost) as much about community as it is about music.',4,'2011-07-05 19:01:45','2011-07-19 17:09:45','http://www.villagevoice.com/events/afrolicious-pleasuremaker-senor-oz-2659799/','','',137,'',1,0,'d1c3adf447'),
