	(1773,'http://www.villagevoice.com/events/bouncing-souls-2661546/','Bouncing Souls','bouncing-souls','For the past few years, the Gaslight Anthem have soaked up what attention the world outside New Jersey has for hard-working punk bands from New Brunswick. Nearly two decades before Brian Fallon and his boys came on the scene, though, the Bouncing Souls were doing their thing, as youll be reminded during the bands engagement this week at the Highline Ballroom, where theyre scheduled to play all eight of their studio albums over the course of four evenings (starting July 6). Tonight, they do 1997s self-titled effort and 99s Hopeless Romantic, the title of which goes a long way toward describing the Souls sweet-and-scrappy charm.',4,'2011-07-05 19:02:18','2011-07-19 17:09:46','http://www.villagevoice.com/events/bouncing-souls-2661546/','','',137,'',1,0,'b64d76eb7b'),
