	(1778,'http://www.villagevoice.com/events/sbtrkt-2654707/','SBTRKT','sbtrkt','Maybe masks are the new faces. Or maybe we all have phones in front of our mugs, anyway, so what\'s the difference? UK producer SBTRKT is yet another artist who\'s used the mystery of a (currently) obscured identity to build buzz for his music, which recently arrived with the requisite hype attachment via a self-titled debut on the XL imprint Young Turks. On it, he presents dub-step blips, brittle percussion algorithms, and knob-twisted forays into Four Tet\'s universe, plus guest shots from dance types such as Little Dragon. There is melody unmasked in the digital muck, too, and if dude plays live, he\'s a pretty sick drummer. With Mux Mool and Shigeto.',4,'2011-07-05 19:02:19','2011-07-19 17:09:46','http://www.villagevoice.com/events/sbtrkt-2654707/','','',137,'',1,0,'13e806eb0f'),
