	(1801,'http://www.villagevoice.com/events/express-your-inner-feiffer-dancer-2661583/','Express Your  Inner Feiffer Dancer','express-your-inner-feiffer-dancer','The iconic Village Voice cartoonist Jules Feiffer can add a new title to his extraordinary résuméwhich already includes author, playwright, and Pulitzer Prize winnerand that is choreographer. Today, Feiffers acclaimed Dancer cartoons, which have been brought to life in the Dancer Films (showing at the World Financial Center July 917), inspire the performance Express Your \nInner Feiffer Dancer, a live dance-in at which the cartoonist himself will be creating new drawings, with music by Jane Ira Bloom and dance by Andrea Weber. For those not familiar with the Dancer drawings, your first stop should be to the Feiffer exhibition Extraordinary Moves: A Dance to Spring: The Drawings of Jules Feiffer showcasing his original cartoon strips, watercolors, and iris prints of bodies in motion. At the dance-in, youre invited to burst out into a Feiffer character and get whimsical. We just hope our bodies are that flexible.',4,'2011-07-05 19:02:25','2011-07-19 17:09:46','http://www.villagevoice.com/events/express-your-inner-feiffer-dancer-2661583/','','',4,'',1,0,'b198b5152c'),
