	(1861,'http://www.villagevoice.com/events/hot-festival-2624119/','HOT! Festival','hot-festival','The temperature is rising on the Lower East Side, and for once it has nothing to do with climate change. Yes, Dixon Place\'s  HOT! Festival  returns for its 20th year to celebrate some of the finest gay theater in town, with more than a hundred queer artists performing in a variety of styles. Catch a concert by Boy George protégé Coby Koehl (June 30), a one-woman dance party exploring the sexualization of women by Laryssa Husiak (July 22), a variety show hosted by burlesque sensation World Famous *BOB* (July 28), and talented monologist Marga Gomez\'s ninth solo show  Not Getting Any Younger  (July 29). It kicks off tonight with a free party with artists previewing selections from their latest work; Anti-Diva, the downtown girlfriend duo of Liz Liguori and Jessie Mann, host.',4,'2011-07-05 19:02:39','2011-07-19 17:09:46','http://www.villagevoice.com/events/hot-festival-2624119/','','',125,'',1,0,'0a3bf27052'),
