	(1867,'http://www.villagevoice.com/events/first-annual-belgian-beer-festival-2661575/','First Annual Belgian Beer Festival','first-annual-belgian-beer-festival','Weve all witnessed the abysmal treatment of Belgian imports in New York City. Take, for instance, the belligerent hordes of Bridge and Tunnel creatures thrashing their way through Pommes Frites, or bodegas charging a mint for Chimay six-packs, or IHOP infiltrating Lower Manhattan with their soggy and sorry excuse for a waffle. We at the Voice cannot stand by and watch these horrors any longer, and thats why we firmly believe Get Real New Yorks First Annual Belgian Beer Festival is the only way to end the suffering. This two-day, all-you-can-eat-and-drink festival floods New York with 100-plus Belgian-style craft beers, heaps of mussels, waffles, chocolates, and virtually every other Belgian treat imaginable from top NYC Belgian eatery Petite Abeille and raucous entertainment in the Grand Beer Hall. The event is held across four sessions on Friday and Saturday with VIP options available, so snatch up those tickets before the B&T vultures can get to them.',4,'2011-07-05 19:02:41','2011-07-19 17:09:46','http://www.villagevoice.com/events/first-annual-belgian-beer-festival-2661575/','','',114,'',1,0,'6ce6e32ade'),
