	(1880,'http://www.villagevoice.com/events/lawnmower-2654591/','Lawnmower','lawnmower','I initially slept on drummer Luther Gray\'s two-guitar skronkathon when it hit last year, but Lawnmower\'s  West  offers aggro action galore and plenty of articulation, too. On paper it looks somewhat standard, but saxophonist Jim Hobbs brings an idiosyncratic wobble to bear on most of his lines, and those guitars split the diff between plush and piercing. If you want to talk scope, the ugly beauty reaches a peak on a Tom T. Hall nugget.',4,'2011-07-05 19:02:44','2011-07-19 17:09:46','http://www.villagevoice.com/events/lawnmower-2654591/','','',137,'',1,0,'3d677a68c6'),
