	(2007,'http://www.villagevoice.com/events/frolic-stacey-pullen-le-loup-2659805/','\'Frolic: Stacey Pullen+le Loup\'','frolic-stacey-pullenle-loup','Grassroots electronica supporters Frolic celebrate their tenth anniversary with an impressive lineup. Stacey Pullen is among the many great Detroit artists inspired by the Electrifying Mojo and the Belleville Three. With his Black Flag label and under aliases including Silent Phase, Kosmik Messenger, and Black Odyssey, he\'s created a body of work both soulful and seminal. Paris whiz kid le Loup makes startling house for Wolf + Lamb when he isn\'t studying sound engineering. With Stadenco (Verboten), Spinoza (the Bunker), and Da\' Riddim iNya.',4,'2011-07-05 19:03:14','2011-07-19 17:09:47','http://www.villagevoice.com/events/frolic-stacey-pullen-le-loup-2659805/','','',137,'',1,0,'3505e7b230'),
