	(2016,'http://www.villagevoice.com/events/kid-cudi-2659645/','Kid Cudi','kid-cudi','This guy is looking to be an overachiever on the level of James Franco. Right now, he\'s on every major rapper\'s record except for Eminem\'s, crafting a mixtape, working on his solo hip-hop album and one with his new rock band, starting his own label, and appearing in an HBO series,  How to Make It in America . Whether his quantity affects his quality remains to be seen. For his show, expect lighters to go up when he does \"Day \'n\' Nite\" (not to mention \"Marijuana\") and for him to pull out built-in sing-alongs such as \"Revofev,\" \"Erase Me,\" and \"Mojo So Dope.\"  With Chip Tha Ripper.',4,'2011-07-05 19:03:15','2011-07-19 17:09:47','http://www.villagevoice.com/events/kid-cudi-2659645/','','',137,'',1,0,'b75fc84fc8'),
