	(2022,'http://www.villagevoice.com/events/henry-v-2639053/','Henry V','henry-v','Today in Battery Park, New York Classical Theatre asks you to pretend not to see the hot-dog vendors and guys dressed like the Statue of Liberty. Instead, for their roving production of  Henry V , imagine its early-15th-century England, King Henry IV has died, and his young son, Henry V, a notorious playboy, has just assumed the throne and plans to invade France. Join King Henry and his valiant army as they cross the English Channel (er, New York Harbor) and head to France (Governors Island) for the Battle of Agincourt. Those brave enough to take on this mission should pick up wristbands for travel to and from Governors Island, available before each show at a booth in Battery Park starting at 5, with a limit of two wristbands per person. (The show is part of the River to River Festival.)',4,'2011-07-05 19:03:17','2011-07-19 17:09:47','http://www.villagevoice.com/events/henry-v-2639053/','','',125,'',1,0,'5c7bfceb8b'),
