	(2086,'http://www.villagevoice.com/events/summerstage-festival-slick-rick-2659797/','\'Summerstage Festival: Slick Rick\'','summerstage-festival-slick-rick','In retrospect, the alternately sexual and sexist braggadocio that turned Rick the Ruler into one of the most attention-grabbing British rappers of the late \'80s and early \'90s now seems acutely self-aware, as though he\'s in on the pure stupidity of it all. The same can\'t always be said of Odd Future and Tyler, the Creator, so at the very least, Slick Rick of 2011 still serves to distinguish hip-hop\'s true misogyny from its lesser, dumbassed chauvinism. Baby steps, folks--the journey of a thousand miles begins with a single \"get back in the kitchen\" joke. With DJ Brucie B.',4,'2011-07-05 19:03:33','2011-07-19 17:09:47','http://www.villagevoice.com/events/summerstage-festival-slick-rick-2659797/','','',137,'',1,0,'be08bcc8d3'),
