	(2094,'http://www.villagevoice.com/events/celebrate-brooklyn-los-lobos-hello-seahorse-zigmat-2658701/','\'Celebrate Brooklyn: Los Lobos+Hello Seahorse!+Zigmat\'','celebrate-brooklyn-los-loboshello-seahorsezigmat','This Latin Alternative Music Conference lineup\'s fathers-and-offspring umbrella is one relaxed fit. East LA\'s venerable Los Lobos long ago coalesced into a universally satisfying roots-rock party machine, one equally impressive with either Mexican folk music and breezy Grateful Dead covers. Hello Seahorse! singer Denise Gutierrez is the rock-noir focus of a guitarless trio from Mexico that had a 2009 hit with  Bestia . Brooklyn electropop (emphasis on \"pop\") trio Zigmat features Puerto Rican singer Monica Rodriguez.',4,'2011-07-05 19:03:35','2011-07-19 17:09:48','http://www.villagevoice.com/events/celebrate-brooklyn-los-lobos-hello-seahorse-zigmat-2658701/','','',137,'',1,0,'ec41ddd20d'),
