	(2109,'','Taylor Swift','taylor-swift','The SPEAK NOW WORLD TOUR 2011 is one of the most-anticipated musical experiences of the year, as Taylor’s live show is renowned for her incredibly high-energy theatrical presentation of graphics, sets and visual elements, all conceptualized by Taylor herself. During the course of her show, Taylor plays a variety of instruments and has multiple wardrobe changes. Each show, Taylor performs hit after hit from her three Big Machine Records albums, including the chart-topping ’’Mine,’’ ’’Love Story,’’ ’’You Belong With Me,’’ ’’Our Song,’’ and ’’Fifteen.’’',NULL,'2011-07-06 18:36:27','2011-07-20 12:44:04','http://www.prucenter.com/default.asp?id=87&objid=880','','',30,'event_images/TaylorSwiftImage-1.png',1,0,'3b537d816a'),
	(2110,'','\"The Kids Are All Right\" - River Flicks','kids-are-all-right-river-flicks','See the stars, under the stars - watch all of your favorite blockbusters from last year on the big screen, again! This time around, they’re all FREE. From social networking to social misfits, Hudson River Park’s River Flicks has all of last year’s favorite big screen hits! This week, it\'s \"The Kids Are All Right\". Just come on down to Pier 63 Lawn in Chelsea. (Cross 12th Ave at either 22nd or 24th St.) Arrive early, find a spot, and bring a picnic! Bring your own chairs and blankets. There\'s free popcorn, and beverages and snacks available for purchase. Leave at home any pets, bikes (secure them outside of the pier), glass of any kind, alcohol, and weapons. Pier 63 Lawn is accessible to people with disabilities and all movies are open captioned.\r\n\r\n\"The Kids Are All Right\" - The son of a same-sex couple seeks out the sperm donor who made his birth possible in this comedy from writer/director Lisa Cholodenko. The committed parents of two teenage children, Nic (Annette Bening) and Jules (Julianne Moore), are about to send their daughter, Joni (Mia Wasikowska), off to college when her younger brother, Laser (Josh Hutcherson), asks for her help in tracking down his biological father. Reluctantly inquiring with the sperm bank, Joni leaves her number so the office can pass it along to Laser\'s father. Enthusiastic at the thought of meeting his long lost offspring, Paul (Mark Ruffalo) musters the courage to reach out, and the family tree grows a new branch.',NULL,'2011-07-20 12:52:47','2011-07-20 13:35:38','http://riverflicksnyc.com/07.20.11.html','','http://www.filminfocus.com/the_kids_are_all_right',29,'event_images/TheKidsAreAllRightFeaturedImage.png',1,0,'b1d12724d2'),
	(2111,'','Cee Lo Green Live Performance','cee-lo-green-live-performance','On Friday mornings from mid-May through September, the Today Show hosts live performances on its Rockefeller Center stage. Access to the concerts is free and available on a first-come, first-served basis outside of the Today Show\'s Window on the World Studio at 49th Street and Rockefeller Center.\r\n\r\nThe performer this week is Cee Lo Green, the man behind the hit “F*ck You” and one of the vocal coaches on NBC\'s reality talent show \"The Voice\".\r\n\r\nThe performance will run from 7 to 10 AM, so if you want to ensure a good spot, you should plan to arrive one or two hours early. Bring plenty of water and wear a pair of comfortable shoes - you\'ll be standing for quite a while (and having a great time, of course)!',NULL,'2011-07-21 08:48:21','2011-07-21 08:56:25','http://en.wikipedia.org/wiki/Cee_Lo_Green','','',30,'event_images/ceeLoGreen_danMagic.jpeg',1,0,'d2e6a55254'),
