	(2127,'http://www.villagevoice.com/events/the-view-from-a-volcano-the-kitchenand-146-s-soho-years-1971and-150-1985-2654498/','The View from a Volcano: The Kitchens Soho Years, 19711985','the-view-from-a-volcano-the-kitchens-soho-years-19','Once upon a time, before H&M and all the fancy boutiques took over, Soho was home to a little place called the Kitchen, the pioneering home for the avant-garde performing arts. In honor of the 40th anniversary of the Kitchen (which is now in Chelsea), theyve raided their archives for the exhibit The View from a Volcano: The Kitchens Soho Years, 19711985. See videos and other artworks from those inspiring early days by Laurie Anderson, the Beastie Boys, Philip Glass, Bill T. Jones, Meredith Monk, Arthur Russell, Cindy Sherman, Sonic Youth, and the Talking Heads, among others.',4,'2011-07-22 14:48:20','2011-07-22 15:42:59','http://www.villagevoice.com/events/the-view-from-a-volcano-the-kitchenand-146-s-soho-years-1971and-150-1985-2654498/','','',171,'',1,0,'bc0b638230'),
