	(2216,'http://www.villagevoice.com/events/west-side-story-dance-and-sing-along-2692331/','West Side Story Dance & Sing-Along','west-side-story-dance-sing-along','Throw your efforts to control the neighborhood aside when  West Side Story Dance & Sing-Along  rolls into Prospect Park. The 1961 Academy Awardwinning musical, filled with equal parts social commentaries, elaborate melodies, and extended dance sequences, will be celebrated with an outdoor screening, allowing aspiring Marias and Tonys to perfect their finger snaps and polish their renditions of \"Tonight.\" If that\'s not enough to satisfy your latent Broadway diva, noted choreographer Lawrence Goldhuber will assume the role of Officer Krupke to teach famous combinations from the film and lead the crowd in one big musical number. And, no, it doesn\'t matter if you\'re a Shark or a Jet (though in the spirit of the event, Jets will enter at 9th Street and Sharks will enter at 11th.) The fun is all part of the Celebrate Brooklyn! festival.',4,'2011-07-22 14:48:44','2011-07-22 15:42:59','http://www.villagevoice.com/events/west-side-story-dance-and-sing-along-2692331/','','',29,'',1,0,'59485f9446'),
