	(2227,'http://www.villagevoice.com/events/sex-you-im-gonna-2692337/','Sex You (I\'m Gonna)','sex-you-im-gonna','Nathan Phillips likes to have sexso much so that he is trying to sleep with as many people as possible via his comedy show  Sex You (I\'m Gonna) . He must be good in bed because the comedian, who\'s been doing improv for more than 20 years, is about to take his antics across the pond to Scotland for the Edinburgh Fringe Festival. So what can you expect from this one-night stand? Phillips goes to major extremes to woo his audience by using such charming methods as dancing, reciting poetry, singing, live sexting, and serving up Jell-O shots from his bellybutton just for the chance that one person will get on stage and go at it. And he isn\'t afraid to cry to get what he wants. Persistence pays off.',4,'2011-07-22 14:48:47','2011-07-22 15:42:59','http://www.villagevoice.com/events/sex-you-im-gonna-2692337/','','',33,'',1,0,'ec96931e43'),
