	(2241,'http://www.villagevoice.com/events/a-tribute-to-sassy-magazine-2692869/','A Tribute to Sassy Magazine','a-tribute-to-sassy-magazine','Tavi Gevinson , who started her blog Fashion Rookie at the ripe old age of 11, quickly became an Internet sensation, scoring front row seats at big runway shows like Marc Jacobs, styling the editorial pages of  BlackBook , and even attracting the attention of fashion ruler Anna Wintour. Now 15, Gevinson is paying tribute to the one publication that inspired her and a generation of girls (even though she wasn\'t even alive during the magazine\'s run).  A Tribute to Sassy Magazine , a part of Littlefield\'s Talent Show program, is a variety show that will include a performance by Gevinson, who is now a guest blogger on former  Sassy  editor Jane Pratt\'s excellent new website xojane.com. Ira Glass, Janeane Garofalo, and funnyman Dave Hill are also on the bill. If you\'re one of those women (like us!) who fondly remember  Sassy  as the magazine that revolutionized her life (because it really, really did!), you won\'t want to miss it.',4,'2011-07-22 14:48:51','2011-07-22 15:43:00','http://www.villagevoice.com/events/a-tribute-to-sassy-magazine-2692869/','','',174,'',1,0,'a4781ec220'),
