	(2284,'http://www.villagevoice.com/events/the-freakiest-and-funniest-food-tour-2674763/','The Freakiest and Funniest Food Tour','the-freakiest-and-funniest-food-tour','If garden salads and oatmeal are your things, then this may not be the tour for you. If you love exotic delicacies and put up with Andrew Zimmerman every week to prove it, then this is pig\'s foot, two-week-old egg heaven for you. Bon appetite and tell your stomach we wish it the best of luck.',4,'2011-07-22 14:49:03','2011-07-22 15:43:00','http://www.villagevoice.com/events/the-freakiest-and-funniest-food-tour-2674763/','','',117,'',1,0,'5c95a8fd3d'),
