	(2286,'http://www.villagevoice.com/events/warm-up-2647250/','Warm Up','warm-up','We know the logistics of living in a cramped apartment can be a bit rough, especially during the hot months of summer. But now MOMA P.S.1\'s  Warm Up  series has your escape plan covered every Saturday through Labor Day weekend. Now in its 14th year, the party will once again take place in the museum\'s courtyard--this year under a canopy of ropes, where you can dance, play ping-pong, or lounge on benches. To curate the season\'s lineup, they\'ve recruited local tastemakers, including Jonathan Galkin (DFA Records), Brandon Stosuy ( Stereogum ), and Robin Carolan (Tri Angle Records), among others--and the results are stellar. It kicks off today with sets from Zoovox, DJ Pierre, Beautiful Swimmers, Delicate Steve, and Protect-U. Then mark your calendar for these upcoming shows: Gang Gang Dance (July 23), Das Racist (July 30), Black Dice (August 13), Juan Maclean (August 20), and Tanlines (August 27).',4,'2011-07-22 14:49:03','2011-07-22 15:43:00','http://www.villagevoice.com/events/warm-up-2647250/','','',137,'',1,0,'a6e8390337'),
	(2287,'http://www.villagevoice.com/events/the-holy-mountain-2692805/','The Holy Mountain','the-holy-mountain','Dir. Alejandro Jodorowsky (1973).',4,'2011-07-22 14:49:04','2011-07-22 15:43:00','http://www.villagevoice.com/events/the-holy-mountain-2692805/','','',173,'',1,0,'c73f970570'),
	(2288,'http://www.villagevoice.com/events/etienne-de-crandeacute-cy-2692342/','Etienne de Crécy','etienne-de-crecy','The more sunburn-courting types among us may recall  Etienne de Crécy \'s 2009 set at the Coachella Festival, in which the French DJ/producer resolutely dropped hypno-delic electro beats from within a giant, transfixing neon cube divided into nine shifting chambers, like a real-life representation of watching Hollywood Squares on expired kombucha. (What, you haven\'t tried that? For shame.) De Crécy is a reigning dance scion of France, and his dual  Super Discount  discs stand as some of the most galvanizing dance music to ever shake rumps in his native Lyonand everywhere else, too. He\'s finally releasing new material to follow up 2007\'s  Commercial EP2 , and headlining the terribly trendy Girls & Boys party to bootso do your part for international relations and bounce along,  s\'il vous plait .',4,'2011-07-22 14:49:04','2011-07-22 15:43:00','http://www.villagevoice.com/events/etienne-de-crandeacute-cy-2692342/','','',137,'',1,0,'1bd03bb03d'),
	(2289,'http://www.villagevoice.com/events/the-chapin-sisters-2685906/','The Chapin Sisters','the-chapin-sisters','After gaining notoriety for their morose cover of Britney Spears\'s \"Toxic,\" Abigail and Lily Chapin got rid of their third half-sis and toured with She & Him. On last year\'s  Two , their depressive folk engaged with brief moments of sunshine and gained the attention of Gang Gang Dance\'s Jesse Lee, who acts as one of their producers. Onstage, their wild manes and bohemian couture make them look like harmonizing Olsen Twins; their haunting harmonies add a sinister edge to the familial bond. With Sean Rowe.',4,'2011-07-22 14:49:04','2011-07-22 15:43:00','http://www.villagevoice.com/events/the-chapin-sisters-2685906/','','',137,'',1,0,'53ee843b9b'),
