	(2305,'http://www.villagevoice.com/events/meatopia-3rd-ward-pig-roast-2692398/','Meatopia+3rd Ward Pig Roast','meatopia3rd-ward-pig-roast','Hagler vs. Hearns, Palin vs. logic, Cheetos vs. Cool Ranch Doritoslife\'s full of endlessly complex match-ups and decisions we can\'t help but scratch our heads over.  This weekend\'s no different. That\'s righttwo colossal carnivorous feasts descend on New York City boasting the finest sinews and fatty tissue New York farms have to offer. Fighting out of the Red Corner:  Meatopia , a meat lovers\' dream that packs a punch with famous chefs from all over the country, a menu that only Leif Ericson could love (roasted lambs, ducks, savory Angus, and prime pork), and live music to accompany the voluminous chewing. Its opponent: the oh-so-gluttonous  3rd Ward Pig Roast , a four-year veteran of the belly-busting circuit. 3rd Ward enters the culinary ring with miraculously innovative BBQ, a swine-centric menu for all ya\'ll pork lovers, and the delightful sounds of the Union Street Preservation Society and the Northern Bells.  Meatopia, at 5:30 p.m., Brooklyn Bridge Park, Pier 5, Brooklyn, meatopia.org, $85$195; 3rd Ward Pig Roast, at 2 p.m., 3rd Ward, 195 Morgan Avenue, Brooklyn, 718-715-4961, 3rdward.com,  free',4,'2011-07-22 14:49:08','2011-07-22 15:43:00','http://www.villagevoice.com/events/meatopia-3rd-ward-pig-roast-2692398/','','',38,'',1,0,'4d7ea025b0'),
