	(2334,'http://www.villagevoice.com/events/anamanaguchi-2685974/','Anamanaguchi','anamanaguchi','Anamanaguchi never met a soft curve they liked. The NYC quartet\'s frazzled hard-angle jams inflate chiptune until it becomes pop, dropping rock elements on Pookas and Fygars (see: Namco game  Dig Dug ) and cutting harsh black lines around every soft substance in the known universe. They are more ADD than Girl Talk straddling a giant pill of Adderall. And yet, if you\'re into this sort of thing, there\'s a craft to the combo\'s reclamation of ancient NES parts and crap circuit boards, to their rebuilding of rock music in the hyperized image of some underground  Zelda  hero. Tech is inescapable and forever being put to work--it should at least be allowed to help us rock. With MATH the Band and Talk to Animals.',4,'2011-07-22 14:49:16','2011-07-22 15:43:00','http://www.villagevoice.com/events/anamanaguchi-2685974/','','',137,'',1,0,'66181d1ab2'),
	(2335,'http://www.villagevoice.com/events/moveable-feast-fresh-produce-and-the-nyc-green-cart-program-2669606/','Moveable Feast: Fresh Produce and the NYC Green Cart Program','moveable-feast-fresh-produce-and-the-nyc-green-car','Moveable Feast: Fresh Produce and the NYC Green Cart Program documents an innovative NYC Department of Health and Mental Hygiene program that provides underserved communities with access to fresh fruits and vegetables via hundreds of independently owned, mobile produce stands known as Green Carts. The exhibition features new photographs by LaToya Ruby Frazier, Thomas Holton,Gabriele Stabile, Will Steacy, and Shen Wei, who were commissioned by the Aperture Foundation to chronicle the initiative over the course of a year.',4,'2011-07-22 14:49:16','2011-07-22 15:43:00','http://www.villagevoice.com/events/moveable-feast-fresh-produce-and-the-nyc-green-cart-program-2669606/','','',121,'',1,0,'4fdde42681'),
