	(2489,'http://www.villagevoice.com/events/russ-lossings-oracle-2691891/','Russ Lossing\'s Oracle','russ-lossings-oracle','If you don\'t walk the straight and narrow, you just might wind up pushing the excursive and poetic, the way pianist Lossing has for the past several years. His trios have a way of subsidizing intuition. If jazz is guesswork mixed with craft, then his new  Hatology  finds him and his team firing on all cylinders. Positioning rumination as a request and grace as an edict, they search for an insightful flow. Michael Attias\'s Renko shares the bill.',4,'2011-07-22 14:49:57','2011-07-22 15:43:01','http://www.villagevoice.com/events/russ-lossings-oracle-2691891/','','',137,'',1,0,'68fa3fe61f'),
