	(2496,'http://www.villagevoice.com/events/halcyon-presents-anthony-collins-adultnapper-2691925/','Halcyon Presents Anthony Collins+Adultnapper','halcyon-presents-anthony-collinsadultnapper','French house is the easy way to categorize Anthony Collins\'s music--but it\'s a heavily Americanized strain of house, informed as much by jazz as by Daft Punk. Indeed, it turns out that he\'s New York-born. He\'s released increasingly well-received discs on Euro-labels Mule Electronic, Tuning Spork, Freak \'n\' Chic and Get Physical, and he\'s a regular guest at our city\'s own Blkmarket Membership. Once upon a time, Francis Harris ran the Matter-Form parties; he continues to make brainy techno as Adultnapper.',4,'2011-07-22 14:49:59','2011-07-22 15:43:01','http://www.villagevoice.com/events/halcyon-presents-anthony-collins-adultnapper-2691925/','','',137,'',1,0,'8bd485776b'),
