	(2499,'http://www.villagevoice.com/events/game-play-2011-2661725/','Game Play 2011','game-play-2011','Forever solidifying the Brick as the theatrical destination for nerds, the Williamsburg theater follows up its inaugural Comic Book Theater Festival with the return of Game Play. The third-annual fest celebrates those pixelated bits that make up the worlds beloved video games. Tonight (July 9), check out Modal Kombat, an improvisational and violent take on Guitar Hero. Guitarists David Hindman and Evan Drummond do battle by controlling their video game characters with their classical-electric guitars. Then stick around for Son of Pong, John DeVores memoir about competing with video games for his fathers attention.  Modal Kombat at 7, Son of Pong,\' July 9 at 9, festival runs through July 31. ',4,'2011-07-22 14:50:00','2011-07-22 15:43:01','http://www.villagevoice.com/events/game-play-2011-2661725/','','',125,'',1,0,'e240b6096d'),
