	(2503,'http://www.villagevoice.com/events/subdivision-2-presents-mike-huckaby-2691929/','Subdivision 2 Presents Mike Huckaby','subdivision-2-presents-mike-huckaby','Mike Huckaby has impressive Detroit credentials. He\'s been in the scene since the Music Institute Days running the Record Time store, mentoring youth, helping to design audio software, and producing the occasional track. His records are rare, carefully crafted masterpieces informed by Chicago house and avant-jazz  (see his new Sun Ra edits); his DJ sets are joyous and filled with classics.  With resident Insideout and Juan Gaviria (Den of Thieves) and Patrick Russell (Mentalux and Circus Company).',4,'2011-07-22 14:50:01','2011-07-22 15:43:01','http://www.villagevoice.com/events/subdivision-2-presents-mike-huckaby-2691929/','','',137,'',1,0,'06561c156b'),
