	(2506,'http://www.villagevoice.com/events/ostalgia-2677773/','Ostalgia','ostalgia','Do you pine for the Age Of Reagan, when our enemy was a clearly defined Evil Empire? The New Museums  Ostalgia  exhibition derives its title from a German word evoking a nostalgic longing for those Cold War days before the communist blocs dissolution in 1991. Works by 50 artists hailing from 20 different countriesa few of which didnt even exist two decades agoinclude interviews with Marxist theory teachers who were suddenly jobless after the collapse of the Berlin Wall and portraits of Siberian beachgoers. Ostalgia promises to liberate some cultural gems from the ash heap of history.',4,'2011-07-22 14:50:01','2011-07-22 15:43:01','http://www.villagevoice.com/events/ostalgia-2677773/','','',121,'',1,0,'159d209150'),
