	(2695,'http://www.villagevoice.com/events/wax-poetic-records-showcase-afrika-bambaataa-meets-chico-mann-2672463/','Wax Poetic Records Showcase: Afrika Bambaataa meets Chico Mann','wax-poetic-records-showcase-afrika-bambaataa-meets','During Bambaataa\'s early years, he was a founding member of the Bronx River Projects-area street gang, The Savage Seven. Due to the explosive growth of the gang, it later became known as the Black Spades, and he rose to the position of Division Leader. After a life-changing visit to Africa, he changed his name to Afrika Bambaataa Aasim. Bambaataa was influenced by the depiction of the Zulu warriors attacking British troops at Rorke\'s Drift in the Michael Caine film Zulu.',4,'2011-07-22 14:51:01','2011-07-22 15:43:02','http://www.villagevoice.com/events/wax-poetic-records-showcase-afrika-bambaataa-meets-chico-mann-2672463/','','',139,'',1,0,'42c42e69a7'),
	(2696,'http://www.villagevoice.com/events/shape-up-nyc-african-dance-2680877/','Shape Up NYC: African Dance','shape-up-nyc-african-dance','Killing two pounds with one move, African Dance teaches you a wide range of rhythms from below the equator so as to keep yours slim.',4,'2011-07-22 14:51:01','2011-07-22 15:43:02','http://www.villagevoice.com/events/shape-up-nyc-african-dance-2680877/','','',4,'',1,0,'bc87149ae8'),
