	(2703,'http://www.villagevoice.com/events/wonders-of-the-universe-an-evening-with-brian-cox-2664202/','Wonders of the Universe: An Evening with Brian Cox','wonders-of-the-universe-an-evening-with-brian-cox','In Wonders of the Universe Professor Brian Cox uses the evidence found in the natural world to explain its underlying simplicity, showing us how the vast and unfathomable phenomena of deep space can be explained, and even experienced.',4,'2011-07-22 14:51:04','2011-07-22 15:43:02','http://www.villagevoice.com/events/wonders-of-the-universe-an-evening-with-brian-cox-2664202/','','',34,'',1,0,'54b3722911'),
