	(2706,'http://www.villagevoice.com/events/disappears-the-psychic-paramount-2696222/','Disappears+the Psychic Paramount','disappearsthe-psychic-paramount','',4,'2011-07-22 14:51:04','2011-07-22 15:43:02','http://www.villagevoice.com/events/disappears-the-psychic-paramount-2696222/','','',137,'',1,0,'5839ac3a64'),
	(2707,'http://www.villagevoice.com/events/thomas-mapfumo-and-the-blacks-unliminted-akoya-afrobeat-ensemble-2680641/','Thomas Mapfumo & the Blacks Unliminted+Akoya Afrobeat Ensemble','thomas-mapfumo-the-blacks-unlimintedakoya-afrobeat','Hung on the elegantly minimalist mbira rhythms of Zimbabwe\'s Shona tribe, a Mapfumo show is a hypnotic seance and simmering protest rally at the same time. Guitars pick up the thumb-piano pulse and run, drums set your brain on trance, and through it all, Mapfumo chants like the Grand Inquisitor who must haunt miserable Robert Mugabe\'s ugliest nightmares. Upstate\'s horn-driven 15-piece Akoya Afrobeat Ensemble opens.',4,'2011-07-22 14:51:05','2011-07-22 15:43:02','http://www.villagevoice.com/events/thomas-mapfumo-and-the-blacks-unliminted-akoya-afrobeat-ensemble-2680641/','','',137,'',1,0,'16aae5a441'),
	(2708,'http://www.villagevoice.com/events/the-soundtrack-series-2672462/','The Soundtrack Series','the-soundtrack-series','Dana Rossi hosts a monthly merging of stories and songs in this legendary music venue. Six artists--writers, comics, actors and musicians--tell the stories they associate with songs of their choosing. There\'s the song, the story behind the song, and the story inspired by the song. We\'re the third one. Featuring: Dan Kois, Lindsey Moore, Abe Goldfarb, Mac Rogers, Brett Berk, and Dana Rossi.',4,'2011-07-22 14:51:05','2011-07-22 15:43:03','http://www.villagevoice.com/events/the-soundtrack-series-2672462/','','',34,'',1,0,'709bed2f7b'),
	(2709,'http://www.villagevoice.com/events/danny-mixon-quartet-2695919/','Danny Mixon Quartet','danny-mixon-quartet','',4,'2011-07-22 14:51:05','2011-07-22 15:43:03','http://www.villagevoice.com/events/danny-mixon-quartet-2695919/','','',137,'',1,0,'0a20801489'),
	(2710,'http://www.villagevoice.com/events/big-busk-2692867/','Big Busk','big-busk','Billy Bragg, the British folk singer-songwriter and rabble-rouser, returns to his roots playing street corners today when he kicks off the Lincoln Center Out of Doors Festival with the  Big Busk , where anyone with an acoustic guitar is invited to sing and play along with the iconic troubadour. At 4, Bragg will lead a group rehearsal for all the guitarists to practice that evening\'s songs. Buskers can then sign up to perform their own material in Lincoln Center\'s plazas before the concert. Bragg will play a selection of his best-known tunes, as well as songs chosen in advance from suggestions taken online in the weeks leading up to the event. Expect someone to request his brand-new ode to Rupert Murdoch, \"Never Buy the Sun.\"',4,'2011-07-22 14:51:06','2011-07-22 15:43:03','http://www.villagevoice.com/events/big-busk-2692867/','','',114,'',1,0,'38a08ac627'),
	(2711,'http://www.villagevoice.com/events/tank-brandon-hines-2696075/','Tank+Brandon Hines','tankbrandon-hines','',4,'2011-07-22 14:51:06','2011-07-22 15:43:03','http://www.villagevoice.com/events/tank-brandon-hines-2696075/','','',137,'',1,0,'98db581a09'),
	(2712,'http://www.villagevoice.com/events/gray-2692317/','Gray','gray','The radiant child himself, painter Jean-Michel Basquiat, churned out splitting riffs at CBGB\'s with late-\'70s industrial-rockers  Gray . He was joined by an impressive slate of downtown experimentalists: performance artists Michael Holman, Nicholas Taylor, Justin Thyme, and Vincent Gallo. Following the artist\'s death, the surviving members of Gray have only reunited twice: for his memorial in 1988 and for a scene in 1996\'s tributary flick  Basquiat . They reconvene tonight in support of  Shades ofINSERT INTO `events_event_categories` (`id`, `event_id`, `category_id`)
