	(668,68,'','Hudson River Park - Pier 63','hudson-river-park-pier-63','','','212-627-2121','http://www.hudsonriverpark.org/events.asp','info@hrpt.state.ny.us','What is Hudson River Park?\r\nIt is the largest park to undergo construction in Manhattan since Central Park was created, and includes beautiful public piers, a waterside esplanade, and limited commercial activities at several sites. \r\n\r\nFunding is being provided by city, state, federal and some private sources. The park does not receive any operational funding from public sources. By State law, all revenue generated within the park, whether from park tenants to permit fees, may only be used for the park’s design, construction, maintenance or operations.',1,'2011-07-20 13:27:20','2011-07-20 13:35:02','','location_images/hrplogo.gif'),
